import React from "react"
import pokemons from "./data";
import Pokemons from "./data";
import Pokemons2 from "./pokemons";


class App extends React.Component {
  render() {
    return (
      <div>
        {Pokemons.map(user => <Pokemons2 user={pokemons.pokemons}/>)}
   </div>
    )
  }
}
export default App;
